import './App.css';
import Header from './header/Header';
function App() {



  return (
    <div className="App">
      <div>
        <Header/>
      </div>       
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
    </div>
  );
}

export default App;
